import './Navbar.css';
export default function Navbar() {
  return (
    <div class="navbar">
      <div class="container">
        <div class="logo">
          <img src="img/9camp.png" alt="Logo 9CAMP" />
        </div>
        <div class="menu">
          <div class="botao">
            <img src="img/add.png" alt="Botão Adicionar" />
          </div>
          <div class="botao">
            <img src="img/logout.png" alt="Botão Logout" />
          </div>
        </div>
      </div>
    </div>
  );
}
